import React from "react";
import '../styles/navbar.css'

const Navbar = ({size , setShow}) => {
    return (
        <nav className="nav_box">
            <span className="my_shop">
                <h2>My Shop</h2>
            </span>
            <div className="cart" >
                <span>
                    <i className="fas fa-cart-plus"></i>
                </span>
                <span>
                    <h3>{size}</h3>
                </span>
            </div>
        </nav>
    );
}

export default Navbar;
